/**
 * @param {number[]} nums
 * @param {number} l
 * @param {number} r
 * @return {number}
 */
var countSubMultisets = function(nums, l, r) {
    const MOD = 1e9 + 7;
    let sum = nums.reduce((a, b) => a + b, 0);
    let dp = Array.from({ length: sum + 1 }, () => 0);
    dp[0] = 1;
    for (let num of nums) {
        for (let i = sum; i >= num; i--) {
            dp[i] = (dp[i] + dp[i - num]) % MOD;
        }
    }
    let prefixSum = Array.from({ length: sum + 1 }, () => 0);
    for (let i = 1; i <= sum; i++) {
        prefixSum[i] = (prefixSum[i - 1] + dp[i]) % MOD;
    }
    return (prefixSum[r] - (l > 0 ? prefixSum[l - 1] : 0) + MOD) % MOD;
};
